import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { Container } from 'react-bootstrap';
import MovieList from './components/MovieList';
import AddMovieForm from './components/AddMovieForm';
import MovieDetails from './components/MovieDetails';
import Filter from './components/Filter';

const App = () => {
  const initialMovies = [
    {
      id: 1,
      title: "Inception",
      description: "A thief who enters the dreams of others to steal secrets.",
      posterURL:
        "https://m.media-amazon.com/images/M/MV5BMjAxMzY3NjcxNF5BMl5BanBnXkFtZTcwNTI5OTM0Mw@@._V1_.jpg",
      rating: 4.5,
    },
    {
      id: 2,
      title: "The Dark Knight",
      description: "Batman must confront the Joker to save Gotham City.",
      posterURL:
        "data:image/jpeg;base64,",
      rating: 4.8,
    },
    {
      id: 3,
      title: "The Shawshank Redemption",
      description:
        "Two imprisoned men bond over a number of years, finding solace and eventual redemption through acts of common decency.",
      posterURL:
        "data:image/jpeg;base64,",
      rating: 9.3,
    },
    {
      id: 4,
      title: "Pulp Fiction",
      description:
        "The lives of two mob hitmen, a boxer, a gangster's wife, and a pair of diner bandits intertwine in four tales of violence and redemption.",
      posterURL:
        "data:image/jpeg;base64,",
      rating: 8.9,
    },
    {
      id: 5,
      title: "Fight Club",
      description:
        "An insomniac office worker and a devil-may-care soapmaker form an underground fight club that evolves into something much, much more.",
      posterURL:
        "data:image/jpeg;base64,",
      rating: 8.8,
    },
    {
      id: 6,
      title: "Forrest Gump",
      description:
        "The presidencies of Kennedy and Johnson, the Vietnam War, the Watergate scandal, and other historical events unfold from the perspective of an Alabama man with an IQ of 75, whose only desire is to be reunited with his childhood sweetheart.",
      posterURL:
        "data:image/jpeg;base64,",
      rating: 8.8,
    },
    {
      id: 7,
      title: "The Matrix",
      description:
        "A computer hacker learns from mysterious rebels about the true nature of his reality and his role in the war against its controllers.",
      posterURL:
        "data:image/jpeg;base64,",
      rating: 8.7,
    },
    {
      id: 8,
      title: "The Lord of the Rings: The Fellowship of the Ring",
      description:
        "A meek Hobbit from the Shire and eight companions set out on a journey to destroy the powerful One Ring and save Middle-earth from the Dark Lord Sauron.",
      posterURL:
        "data:image/jpeg;base64,",
      rating: 8.8,
    },
    {
      id: 9,
      title: "Inglourious Basterds",
      description:
        "In Nazi-occupied France during World War II, a plan to assassinate Nazi leaders by a group of Jewish U.S. soldiers coincides with a theatre owner's vengeful plans for the same.",
      posterURL:
        "data:image/jpeg;base64,",
      rating: 8.3,
    },
    {
      id: 10,
      title: "Goodfellas",
      description:
        "The story of Henry Hill and his life in the mob, covering his relationship with his wife Karen Hill and his mob partners Jimmy Conway and Tommy DeVito in the Italian-American crime syndicate.",
      posterURL:
        "data:image/jpeg;base64,",
      rating: 8.7,
    },
  ];

  const [movies, setMovies] = useState(initialMovies);
  const [filteredMovies, setFilteredMovies] = useState(initialMovies);

  const handleAddMovie = (newMovie) => {
    const updatedMovies = [...movies, { ...newMovie, id: movies.length + 1 }];
    setMovies(updatedMovies);
    setFilteredMovies(updatedMovies); // Update filteredMovies to include the new movie
  };

  const handleFilter = (filterCriteria) => {
    const { title, rating } = filterCriteria;
    const filtered = movies.filter(movie => 
      movie.title.toLowerCase().includes(title.toLowerCase()) && movie.rating >= rating
    );
    setFilteredMovies(filtered);
  };

  return (
    <Router>
      <Container>
        <Routes>
          <Route path="/" exact element={<Home onFilter={handleFilter} movies={filteredMovies} />} />
          <Route path="/add-movie" element={<AddMovie onAddMovie={handleAddMovie} />} />
          <Route path="/movie/:id" element={<MovieDetails movies={movies} />} />
        </Routes>
      </Container>
    </Router>
  );
};

const Home = ({ onFilter, movies }) => {
  return (
    <>
      <Filter onFilter={onFilter} />
      <MovieList movies={movies} />
    </>
  );
};

const AddMovie = ({ onAddMovie }) => {
  return (
    <div>
      <h2>Add Movie</h2>
      <AddMovieForm onAddMovie={onAddMovie} />
    </div>
  );
};

export default App;
